import React from 'react'
import {Col,Button} from 'react-bootstrap'

const Cell = (props) => {

    handClick = (id) =>{
        props.selectCell(id)
    }

    return <Col>
        {props.selected && props.selected.selected ? props.selected.player : <Button onClick={handClick(1)} >Click</Button>}
    </Col>
}

export default Cell;
